import React from "react";
import '../Projects/project.css';
import dotImg from '../Assests/h1-bg.png';
function Projects(){
    return(
        <>
        <div className="projects">
        <div className="centerText">
          <p>projects</p>
          <img src={dotImg} alt="dotimg" />
        </div>
        </div>
        </>
    )
}


export default Projects;
